;; **
;;; To perform machine learning, we randomly split our data into training and test sets.
;; **

;; @@
(def train-or-test
  (repeatedly (fn []
                (if (< (rand) 0.7)
                  :train
                  :test))))

(defn split [data]
  (->> data
       (map vector train-or-test)
       (group-by first)
       (transform [MAP-VALS ALL] second)))

(def x-datasets (split x))
(def y-datasets (split y))
